import React from 'react';
import { Jumbotron, Container } from 'reactstrap';

const LoginJB = (props) => {
  return (
    <div>
      <Jumbotron fluid>
        <Container fluid>
          <h1 className="display-3" color="light">PitchApp</h1>
          <p className="lead" color="light">from ideas to projects</p>
        </Container>
      </Jumbotron>
    </div>
  );
};

export default LoginJB;
